import React from 'react'
import {Grid, Typography, Tooltip, makeStyles, IconButton, CssBaseline} from '@material-ui/core'
import { AddRounded } from '@material-ui/icons'

interface IProps{
    title: string
    isReadOnly: boolean
    handleAddIngredient: () => void
}

const styles = makeStyles((theme) => ({
    subHeaderContainer:{
        display:'flex',
        justifyContent: 'space-between',
        padding:'1vw'
    },
    iconButton:{
        paddingRight:'2vw'
    },
    icon:{
        color:'orange'
    }
}))

const MenuListSubHeader: React.FC<IProps> = (props) => {

    const {title, isReadOnly, handleAddIngredient} = props

    const useStyle = styles() 
    return(
        <Grid
            className={useStyle.subHeaderContainer}
            container>
            <CssBaseline/>
            <Grid
                item>
                <Typography variant='h5'>{title}</Typography>
            </Grid>
            <Grid
                item>
                    {!isReadOnly && (
                <Tooltip title='Add Ingrdient'>
                    <IconButton onClick = {handleAddIngredient}>
                        <AddRounded className={useStyle.icon}/>
                    </IconButton>
                </Tooltip>
                )}
            </Grid>
        </Grid>
    )
}

export default MenuListSubHeader
